script: |
  super -f text -I q4330.spq | sort > q4330.out

inputs:
  - name: q4330.spq
    data: |
      SELECT DISTINCT - 26 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - col0 + - 13 * - + 41 NOT BETWEEN NULL AND ( - col0 ) );
  - name: tab1

outputs:
  - name: q4330.out
    data: |
      -26
